import { SubgraphQueryHandler, } from "../../subgraphQueryHandler";
import { TokenStatisticLogsDocument, } from "./tokenStatisticLogs.generated";
export class TokenStatisticLogQueryHandler extends SubgraphQueryHandler {
    constructor() {
        super(...arguments);
        this.getAddressFieldKeysFromFilter = () => ({
            accountKeys: [],
            tokenKeys: ["token"],
        });
        this.getRelevantAddressesFromResultCore = (result) => ({
            tokens: [result.token],
            accounts: [],
        });
        this.mapFromSubgraphResponse = (response) => response.tokenStatisticLogs.map((x) => ({
            ...x,
            blockNumber: Number(x.blockNumber),
            timestamp: Number(x.timestamp),
            token: x.token.id,
        }));
        this.requestDocument = TokenStatisticLogsDocument;
    }
}
